#include <amxmodx>
#include <amxmisc>
#include <fun>

#define MAX_POINTS 100

new g_painting[33]; // Array to check if a player is painting
new Float:g_paintPoints[33][MAX_POINTS][3]; // Array to store the points
new g_paintCount[33]; // Array to store the number of points per player

// Plugin details
public plugin_init() {
    register_plugin("Painter System", "1.0", "CheezPuff");
    register_clcmd("say /painter", "CmdPainter");
    register_clcmd("say_team /painter", "CmdPainter");

    register_clcmd("+use", "StartPaint"); // Bind to start painting
    register_clcmd("-use", "StopPaint"); // Bind to stop painting
}

public plugin_cfg() {
    log_amx("Painter System plugin loaded!");
}

// Command to toggle painting mode
public CmdPainter(id) {
    if (!is_user_connected(id)) return PLUGIN_HANDLED;
    if (!is_user_alive(id)) return PLUGIN_HANDLED;
    if (get_user_team(id) != 2) { // Check if the player is a CT
        client_print(id, print_chat, "Only CTs can use this command.");
        return PLUGIN_HANDLED;
    }

    if (g_painting[id]) {
        g_painting[id] = 0;
        client_print(id, print_chat, "Painting mode disabled. You can no longer paint.");
    } else {
        g_painting[id] = 1;
        g_paintCount[id] = 0;
        client_print(id, print_chat, "Painting mode enabled. Use your crosshair to paint on the floor.");
        client_print(id, print_chat, "Press and hold +use (E) to start painting.");
    }
    return PLUGIN_HANDLED;
}

// Command to start painting
public StartPaint(id) {
    if (!is_user_connected(id)) return PLUGIN_HANDLED;
    if (!is_user_alive(id)) return PLUGIN_HANDLED;
    if (get_user_team(id) != 2) return PLUGIN_HANDLED; // Only CTs can paint

    if (g_painting[id]) {
        set_task(0.1, "PaintTask", id);
    }
    return PLUGIN_HANDLED;
}

// Command to stop painting
public StopPaint(id) {
    remove_task(id);
    return PLUGIN_HANDLED;
}

// Task to paint
public PaintTask(id) {
    if (!g_painting[id] || !is_user_alive(id)) return PLUGIN_HANDLED;

    if (g_paintCount[id] < MAX_POINTS) {
        new Float:origin[3];
        get_user_origin(id, origin, 0);
        origin[2] -= 50.0; // Lower the point to be on the floor

        g_paintPoints[id][g_paintCount[id]][0] = origin[0];
        g_paintPoints[id][g_paintCount[id]][1] = origin[1];
        g_paintPoints[id][g_paintCount[id]][2] = origin[2];
        g_paintCount[id]++;
        
        draw_point(id, origin);
    }

    set_task(0.1, "PaintTask", id);
    return PLUGIN_HANDLED;
}

// Function to draw a point
draw_point(id, Float:origin[3]) {
    message_begin(MSG_BROADCAST, SVC_TEMPENTITY);
    write_byte(TE_SPRITE);
    write_coord(floatround(origin[0]));
    write_coord(floatround(origin[1]));
    write_coord(floatround(origin[2]));
    write_short(sprite_index("sprites/white.spr")); // You need to have a white sprite
    write_byte(5); // Scale
    write_byte(255); // Brightness
    message_end();
}

#include <bits/stdc++.h>
using namespace std;
typedef long long ll;
int main()
{ 
    int n;
    cin >> n;
    ll res = LLONG_MAX;
    set<ll> st;
    for(int i = 0; i < n; i++) {
      int tip;
      cin >> tip;

      if(tip == 1) {
        ll x;
        cin >> x;
        st.insert(x);

        auto it = st.lower_bound(x);
        if(it != st.begin()) {
          it--;
          res = min(res, x - *it);
          it++;
        }
        it++;
        if(it != st.end()) {
          res = min(res, *it - x);
        }

      }
      else {
        cout << res << endl;
      }
    }
    return 0;
}

#include <iostream>
#include <queue>
#include <vector>
#include <algorithm>
using namespace std;
int n, m;
char mat[105][105];
int bfs(int si, int sj, int ei, int ej) {
  queue<int> q;
  q.push(si);
  q.push(sj);
  q.push(0);

  vector<vector<bool>> visited(n, vector<bool>(m, false));
  visited[si][sj] = true;
  int di[] = {-1, 1, 0, 0};
  int dj[] = {0, 0, -1, 1};
  while(!q.empty()) {
    int ci = q.front();
    q.pop();
    int cj = q.front();
    q.pop();
    int cekor = q.front();
    q.pop();

    if(ci == ei and cj == ej) {
      return cekor;
    }
    for(int i = 0; i < 4; i++) {
      int ti = ci + di[i];
      int tj = cj + dj[i];
      if(ti >= 0 and ti < n and tj >= 0 and tj < m and !visited[ti][tj] and mat[ti][tj] != '#'){
        q.push(ti);
        q.push(tj);
        q.push(cekor + 1);
        visited[ti][tj] = true;

      }
    }

  }
}
int main()
{ 
  cin >> n >> m;
  vector<pair<int, int>> drinks;
  int si = 0, sj = 0, bi = 0, bj = 0;
  for(int i = 0; i < n; i++) {
    for(int j = 0; j < m; j++) {
      cin >> mat[i][j];
      if(mat[i][j] == 'D') {
        drinks.push_back(make_pair(i, j));
      }
      if(mat[i][j] == 'S') {
        si = i;
        sj = j;
      }
      if(mat[i][j] == 'B') {
        bi = i;
        bj = j;
      }
    }
  }
  vector<int> permutacija;
  for(int i = 0; i < drinks.size(); i++) {
    permutacija.push_back(i);
  }
  int sz = permutacija.size();

  int res = 1000;
  do {
    int path = 0;
    for(int i = 0; i < permutacija.size(); i++) {
      if(i == 0) {
        path += bfs(si, sj, drinks[permutacija[i]].first, drinks[permutacija[i]].second);
      }
      else {
        path += bfs(drinks[permutacija[i]].first, drinks[permutacija[i]].second, drinks[permutacija[i - 1]].first, drinks[permutacija[i - 1]].second);
      }
    }
    path += bfs(drinks[permutacija[sz - 1]].first, drinks[permutacija[sz - 1]].second, bi, bj);
  res = min(res ,path);
  } while(next_permutation(permutacija.begin(), permutacija.end()));
  cout << res << endl;
    return 0;
}
