using System;
using System.Collections.Generic;
using System.Globalization;
using System.Linq;
using System.Runtime.CompilerServices;
using System.Text;
using System.Threading.Tasks;

namespace Inheritance_Base_and_Derived
{
    public class Program
    {
        static void Main(string[] args)
        {
            Car car = new Car("Car", "Toyota", "Camry", 2020, 30.0);
            car.Describe();
            car.DisplayFuelEfficiency();
            car.CalculateFuelConsumption();

            Truck truck = new Truck("Truck", "Ford", "F-150", 2018, 15.0, 1.5);
            Console.WriteLine();
            truck.Describe();
            truck.DisplayFuelEfficiency();
            truck.CalculateFuelConsumption();

            Motorcycle motorcycle = new Motorcycle("Motorcycle", "Honda", "CBR500R", 2021, 500, 60.0);
            Console.WriteLine();
            motorcycle.Describe();
            motorcycle.DisplayFuelEfficiency();
            motorcycle.CalculateFuelConsumption();

            Console.ReadKey();
        }
    }

    class Vehicle
    {
        public string VehicleType { get; set; }
        public string Make { get; set; }
        public string Model { get; set; }
        public int Year { get; set; }

        public Vehicle(string vehicleType, string make, string model, int year)
        {
            this.VehicleType = vehicleType;
            this.Make = make;
            this.Model = model;
            this.Year = year;
        }

    }

    class Car : Vehicle
    {
        public double FuelEfficiency { get; set; }

        public Car(string vehicleType, string make, string model, int year, double fuelEffieciency) : base(vehicleType, make, model, year)
        {
            this.FuelEfficiency = fuelEffieciency;
        }

        public void Describe()
        {
            Console.WriteLine("Vehicle: " + VehicleType);
            Console.WriteLine("Make: " + Make + ", Model: " + Model + ", Year: " + Year);
        }

        public void DisplayFuelEfficiency()
        {
            Console.WriteLine("Fuel Effieciency: " + FuelEfficiency + " mpg");
        }

        public void CalculateFuelConsumption()
        {
            double consumption = 100.0 / FuelEfficiency;
            double roundedConsumption = Math.Round(consumption, 2);
            Console.WriteLine("Fuel Consumption for 100 miles: " + roundedConsumption + " gallons");
        }
    }

    class Truck : Car
    {
        public double CargoCapacity { get; set; }
        public Truck(string vehicleType, string make, string model, int year, double fuelEffieciency, double cargoCapacity)
            : base(vehicleType, make, model, year, fuelEffieciency)
        {
            this.CargoCapacity = cargoCapacity;
        }

        public new void Describe()
        {
            base.Describe();
            Console.Write("Cargo Capacity: " + CargoCapacity + " tons, ");
        }
    }

    class Motorcycle : Car
    {
        public int EngineCapacity { get; set; }
        public Motorcycle(string vehicleType, string make, string model, int year, int EngineCapacity, double fuelEfficiency)
            : base(vehicleType, make, model, year, fuelEfficiency)
        {
            this.EngineCapacity = EngineCapacity;
        }

        public new void Describe()
        {
            base.Describe();
            Console.WriteLine("Engine Capacity: " + EngineCapacity + " cc ");
        }
    }
}
